	      y,
	      i,
	      p,
	      yp,
	      yi,
	      yw,
	      r_sum,
	      g_sum,
	      b_sum,
	      a_sum,
	      r_out_sum,
	      g_out_sum,
	      b_out_sum,
	      a_out_sum,
	      r_in_sum,
	      g_in_sum,
	      b_in_sum,
	      a_in_sum,
	      pr,
	      pg,
	      pb,
	      pa,
	      rbs;
	
