	        g_out_sum -= stackIn.g;
	        b_out_sum -= stackIn.b;
	        a_out_sum -= stackIn.a;
	
	        p = (yw + ((p = x + radius + 1) < widthMinus1 ? p : widthMinus1)) << 2;
	
